import React, { Component } from 'react'

export default class ChatWindow extends Component {
    render() {
        const{chatDataA,chatDataB} = this.props;
        return (
            <div>
                  <ul className="msglist">
            {chatDataA.map((item) => (
              <li style={{color:'green'}}>{"Amy:  "+item}</li>
            ))}
            {chatDataB.map((item) => (
              <li style={{color:'blue'}}>{"John:  "+item}</li>
            ))}
          </ul>
            </div>
        )
    }
}
